import logging
import os
import base64
import zlib
logging.basicConfig(level=logging.INFO,format='%(asctime)s %(filename)s[line:%(lineno)d] %(levelname)s %(message)s',datefmt='%a, %d %b %Y %H:%M:%S')
logging.info("start")

bin_data=''''''
zip_data = base64.b64decode(bin_data)

decompressed_data = zlib.decompress(zip_data,zlib.MAX_WBITS|32)
logging.info(len(decompressed_data))
with open("./out_json.json","wb") as w:
    w.write(decompressed_data)
